'use strict';
let ASaltGenerator = require('./ASaltGenerator.js');
let buffer = require('@gehtsoft/LuaxStdlib-node').buffer;
let io = require('@gehtsoft/LuaxStdlib-node').io;
//@@DocBrief("Uses for salt request id data")
class RequestIDSaltGenerator extends ASaltGenerator {
    decryptSalt(salt) {
        let length, result;
        length = buffer.getEncodedStringLength(salt, io.CP_ANSI);
        result = buffer.create(length);
        result.setEncodedString(0, salt, io.CP_ANSI);
        return result;
    }
}
module.exports = RequestIDSaltGenerator
